CHAPITRE  64 SECTION  XII 
CHAUSSURES, GUETRES ET ARTICLES ANALOGUES ;  
PARTIES DE  CES OBJETS  
Notes.  
1.- Le présent  Chapitre  ne comprend  pas : 
a)les articles  à jeter destinés  à couvrir  les pieds  ou les chaussures,  faits de matériaux  légers
ou peu résistants (papier, feuilles en matière plastique, par exemple) et n’ayant pas de
semelles  rapportées  (régime  de la matière  constitutive);
b)les chaussons en matières textiles, sans sem elles extérieures collées, cousues ou
autrement  fixées  ou appliquées  au dessus  (section  XI);
c)les chaussures  usagées  du n° 63.09;
d)les articles  en amiante  (asbeste)  (n° 68.12);
e)les chaussures  et appareils  d'orthopédie  et leurs parties  (n° 90.21);
f)les chaussures ayant le caractère de jouets et les chaussures auxquelles sont fixés des
patins  (à glace  ou à roulettes);  les protège -tibias  et les autres  articles  de protection  utilisés
pour la pratique  des sports  (Chapitre  95).
2.- Ne sont pas considérés comme parties , au sens du n° 64.06, les chevilles, protecteurs,  
oeillets,  crochets,  boucles,  galons,  pompons,  lacets  et autres  articles  d'ornementation  ou de 
passementerie,  qui suivent  leur régime  propre, ni les  boutons  de chaussures  (n° 96.06).
